	add("union", "{\"term\":\"union\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|union}}, from {{m|la|unionem}}, from Latin \u0027ūnus\u0027 (one)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of uniting or joining two or more things into one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being united or joined\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which is united, or made one; something formed by a combination or coalition of parts or members; a confederation; a consolidated body; a league\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A trade union; a workers\u0027 union\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dIn the autumn there was a row at some cement works about the unskilled labour men. A \u0027\u0027union\u0027\u0027 had just been started for them and all but a few joined. One of these blacklegs was laid for by a picket and knocked out of time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A joint or other connection uniting parts of machinery, such as pipes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The set containing all of the elements of two or more sets\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The act or state of marriage\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Sexual intercourse\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A data structure that can store any of various items, but only one at a time\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A large, high-quality pearl\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"II.3.3\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Nonius the senator hath a purple coat as stiff with jewels as his mind is full of vices; rings on his fingers worth 20,000 sesterces, andan \u0027\u0027union\u0027\u0027 in his ear worth an hundred pounds\u0027 weight of gold\u0026amp;nbsp;[…\", \"priority\":13}]}, \"synonyms\":{}}");

