	add("unipeg", "{\"term\":\"unipeg\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|unicorn|Pegasus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A winged unicorn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"and silver \u0027\u0027unipeg\u0027\u0027 lands and folds his wings remebering the big earth drac\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"location \u003d Lincoln isbn \u003d 0595313957 page \u003d 49 pageurl \u003d http://books.google.com/books?id\u003dzif4FyiVtYwC\u0026amp;pg\u003dPA49\u0026amp;dq\u003dunipegs passage \u003d But, I think it will be too risky to try and steal horses, \u0027\u0027unipegs\u0027\u0027, pegasi, or unicorns. There are spells cast on the animals to keep track of them\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"location \u003d Bloomington isbn \u003d 9781462059294 ol \u003d 25228959M page \u003d 20 pageurl \u003d http://books.google.com/books?id\u003dbHkLynB0GyQC\u0026amp;pg\u003dPA20\u0026amp;dq\u003dunipeg passage \u003d As she whistled the horse, which Aries said was a \u0027\u0027Unipeg\u0027\u0027, which was a combination of a Pegasus and a unicorn landed right there smack in front of Mary it just landed and stared her right in the eyes\", \"priority\":4}]}, \"synonyms\":{}}");

	add("unipersonalism", "{\"term\":\"unipersonalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|unipersonal|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"leadership by a single perso\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, \u0027Philippine Social Sciences and Humanities Review\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A similar remark could be said of Mr. Osmeiia, who was for \u0027\u0027unipersonalism\u0027\u0027 as against collectivism in 1922 but who in 1933 was a collectivist and against the unipersonalism of Mr. Quezon\", \"priority\":3}]}, \"synonyms\":{}}");

